.reverse()\n        list.each { identification ->\n\n            def parts = identification.number.split(\"_\")\n\n            if (parts.size() == 2) {\n\n                Person person = Person.findWhere(number:parts[1], deleted:false)\n                if (person) {\n                    String newNumber = \"PIN_PID=\" + person.id\n                    if (Identification.findWhere(number:newNumber, deleted:false)) {\n                        identification.deleted = true\n                    } else {\n                        identification.number = newNumber\n                    }\n                } else {\n                    identification.deleted = true\n                }\n\n            }\n            triggerWriteService.save(identification)\n        }\n\n		true\n	}\n}'),(695,1,'!at.dockwork.system.service.DataSourceService.existsFieldInDatabaseTable(connection, \'dw_company\', \'receiver\')','',737,'2020-07-24 19:02:35','\0','add column dw_company.receiver','','2020-07-24 19:02:36','2020-07-24 19:02:36','','alter table dw_company add receiver BIT','alter table dw_company add column receiver BIT',0,'condition is false','',''),(696,1,'at.dockwork.system.service.DataSourceService.existsFieldInDatabaseTable(connection, \'dw_company\', \'receiver\')','',738,'2020-07-24 19:02:35','\0','init dw_company.receiver = 0','','2020-07-24 19:02:36','2020-07-24 19:02:36','','update dw_company set receiver = 0 where receiver is null','update dw_company set receiver = 0 where receiver is null',0,'OK','',''),(697,1,'!at.dockwork.system.service.DataSourceService.existsFieldInDatabaseTable(connection, \'dw_company\', \'carrier\')','',739,'2020-07-24 19:02:35','\0','add column dw_company.carrier','','2020-07-24 19:02:36','2020-07-24 19:02:36','','alter table dw_company add carrier BIT','alter table dw_company add column carrier BIT',0,'condition is false','',''),(698,1,'at.dockwork.system.service.DataSourceService.existsFieldInDatabaseTable(connection, \'dw_company\', \'carrier\')','